import React from "react";
import "./Feed.css";
import deski_ash from "../assets/deski_ash.svg";
import { Link } from "react-router-dom";

function Feed() {
    return (
        <div>
            <header>
                <img src={deski_ash} alt="" height="60" width="110" />
                <div className="wrk_nav">
                    <Link to="/workplace" className="wrknav_links">
                        Home
                    </Link>
                    <Link to="/feed" className="wrknav_links active">
                        Feed
                    </Link>
                    <Link to="/template" className="wrknav_links">
                        Templates
                    </Link>
                </div>
            </header>
        </div>
    );
}

export default Feed;
